import React from "react";

function HeadTag(props) {

    const style = {
        "text-align": "left",
        "padding-top": "8%"
    };

    const multiColorText = {
            "background-image": "linear-gradient(to right, black, SlateBlue, green)",
            "-webkit-background-clip": "text",
            "-moz-background-clip": "text",
            "background-clip": "text",
            "color": "transparent"
    }

  return (
    <div>

        <div class="top-down">

          <nav class="navbar navbar-expand-lg" id="top-navbar" style={style}>
            <div class="collapse navbar-collapse" id="navbarNav">
                <h2 style={multiColorText}> {props.Title} </h2>
            </div>

          </nav>

        </div>

    </div>

  );
}

export default HeadTag;
